import Slider from "react-slick";

function MultipleItems() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
  };
  return (
    <div className="w-[80%] m-[0_auto]">
      <Slider {...settings} className="">
        <div>
          <img
            src="data:image/jpeg;base64,"
            className="w-[90%] h-[300px] m-[10px]"
          ></img>
        </div>
        <div>
          <img
            src="data:image/jpeg;base64,"
            className="w-[90%] h-[300px] block m-[10px]"
          ></img>
        </div>
        <div>
          <img
            src="data:image/jpeg;base64,"
            className="w-[90%] h-[300px] block m-[10px]"
          ></img>
        </div>
      </Slider>
    </div>
  );
}

export default MultipleItems;
